import React, { Component } from "react";

const demots = [
  {
    id: 1,
    title: "Go to Market",
  },
  {
    id: 2,
    title: "Study",
  },

];

function renderItems(){
  return demots.map((demot) => {
    <p>{demot}</p>
  })
}

function App() {
  return (
    <renderItems />
  );
}

export default App;
